  function dijkstra(graph, start, end) {
    // initialize a set of visited nodes and a dictionary of distances from start to each node
    visited = new Set()
    distances = new Dictionary()
    for each node in graph.nodes:
      distances[node] = infinity

    // add the start node with distance 0
    distances[start] = 0

    // initialize a priority queue of nodes to visit, sorted by distance from start
    queue = new PriorityQueue()
    queue.enqueue(start, 0)

    // repeat until the queue is empty or the end node is found
    while not queue.isEmpty() {
      // pop the node with the smallest distance from the queue
      current = queue.dequeue()
      if current == end:
        // return the distance to the end node
        return distances[end]
      else {
        // mark the node as visited
        visited.add(current)

        // update the distances of the neighbors of the current node
        for each neighbor in graph.neighbors(current):
          if neighbor not in visited:
            new_distance = distances[current] + graph.weight(current, neighbor)
            if new_distance < distances[neighbor]:
              // update the distance dictionary and the priority queue
              distances[neighbor] = new_distance
              queue.enqueue(neighbor, new_distance)
      }
    }

    // return infinity if there is no path to the end node
    return infinity
}

