```python
import tkinter as tk
from tkinter import simpledialog, messagebox

class BudgetingTool:
    def __init__(self):
        self.income = 0
        self.expenses_dict = {"Essentials": 0, "Savings": 0, "Discretionary": 0}

    def get_income(self):
        self.income = simpledialog.askinteger("Enter Income", "What is your monthly income?")

    def categorize_expenses(self, expenses):
        for expense in expenses:
            category = self.choose_category(expense)
            if category != "":
                self.expenses_dict[category] += expense
            else:
                messagebox.showerror("Invalid Expense", "Please enter a valid expense.")

    def choose_category(self, expense):
        if 0 < float(expense) <= 100:
            return "Essentials"
        elif 100 < float(expense) <= 500:
            return "Savings"
        else:
            return "Discretionary"

    def track_expenses(self):
        while True:
            expenses = simpledialog.askstring("Enter Expense", "What is your current expense?")
            if not expenses:
                break
            category = self.choose_category(expenses)
            if category != "":
                try:
                    self.expenses_dict[category] += float(expense)
                except ValueError:
                    messagebox.showerror("Invalid Expense", "Please enter a valid expense.")
            else:
                messagebox.showinfo("Invalid Expense", "Please enter a category for your expense.")

    def adjust_expenses(self):
        while True:
            new_expense = simpledialog.askstring("Enter New Expense", "What is your desired expense?")
            if not new_expense:
                break
            try:
                self.expenses_dict[self.choose_category(new_expense)] += float(new_expense)
            except ValueError:
                messagebox.showerror("Invalid Expense", "Please enter a valid expense.")
            else:
                messagebox.showinfo("Expense Added Successfully", f"The new expense of ${new_expense} has been added to your category '{self.choose_category(new_expense)}'.")

    def print_summary(self):
        total_income = self.income
        for category, expense in self.expenses_dict.items():
            percentage = (expense / self.income) * 100
            print(f"{category}: {percentage:.2f}% of your income")
            total_income -= expense
        messagebox.showinfo("Summary Report", f"Your current monthly expenses are:\nEssentials: ${self.expenses_dict['Essentials']}\nSavings: ${self.expenses_dict['Savings']}\nDiscretionary: ${self.expenses_dict['Discretionary']}")
        messagebox.showinfo("Your current net income is", f"${total_income:.2f}")
        messagebox.ok()

if __name__ == "__main__":
    budgeting_tool = BudgetingTool()
    budgeting_tool.get_income()
    budgeting_tool.categorize_expenses(["Rent", "Groceries", "Entertainment"])
    budgeting_tool.track_expenses()
    budgeting_tool.adjust_expenses()
    budgeting_tool.print_summary()
```
This code creates a simple GUI with three tabs: income, expenses, and summary. The income tab allows the user to enter their monthly income using a slider. The expenses tab categorizes and tracks the user's expenses based on input from a text box. If an expense is not in one of the predefined categories, the program will show an error message and prompt the user to re-enter it. The adjust_expenses() function allows the user to enter new expenses directly in the same tab. Finally, the summary tab prints out the user's monthly income and expenses as a percentage of their income, as well as a detailed report at the bottom. 
To run this code, you can simply save it as "budgeting_tool.py" and execute it from your terminal or command prompt. You can also customize the GUI by changing the labels and buttons in each tab.

